import React from 'react'
import homeStore from '../stores/homeStore'

function Home() {
  const store = homeStore()

  React.useEffect(() => {
    store.fetchCoins()
  }, [])
  return (
    <>
      {store.coins}
    </>
  )
}

export default Home
